import React from 'react';

const NotFound = () => {
  return (
    <div>
      <h1>Not Found</h1>
      <p className='lead'>The page you are looking for does not exist.</p>
      <p>Try again with some other keyword</p>
    </div>
  );
};
export default NotFound;
